class Solution:
    def twoSum(self, numbers: list[int], target: int) -> list[int]:
        
        index_1 = 0
        index_2 = len(numbers) - 1
        
        while index_1 <= index_2:
            value = numbers[index_1] + numbers[index_2]
            if value == target:
                return [index_1 + 1, index_2 + 1]
            elif value < target:
                index_1 += 1
            else:
                index_2 -= 1
           

        return []
        
        
    
    
           
        

                
            
        

